import React from "react";
import NavBar from "./navbar"
import { useLocation } from 'react-router-dom';

function Events() {
  const location = useLocation();
  const data = location.state.data;
  return (
    <div>
        <NavBar />
        <h1>Events</h1>
        <h2>{data[0]}</h2>
    </div>
    )
};

export default Events;
